import React from 'react';

export default class MakeList extends React.Component{
    constructor(props){
        super(props);

        this.handleChange = this.handleChange.bind(this);
    }
    render(){
        const list = this.props.list.map((li, i) => 
            <li key={i} className='list-group-item text-center'><button className='btn btn-success' onClick={this.handleChange}>{li}</button></li>
        );

        return (
            <ul className='list-group list-group-flush'>
                {list}
            </ul>
        )
    }
    handleChange(e){
        // console.log(e.target);
        this.props.onListClick(e)
    }
}
